import { Container, Row, Col } from "react-bootstrap";
import siyaPic from "../../Resources/Images/1709046179351~2.jpg";
const HomeImage = () => {
	return (
		<Container id="imageBox">
			<img
				id="image"
				src={siyaPic}
				width="30"
				height="30"
				className="d-flex align-top bg-primary"
			/>
		</Container>
	);
};

export default HomeImage;
